import React, { useEffect, useState } from "react"; 
import { MapContainer, TileLayer, Marker, Popup, LayersControl } from "react-leaflet";
import L from "leaflet";
import tileLayer from "../util/tileLayer";

const { BaseLayer, Overlay } = LayersControl;

const center = [39.9334, 32.8597]; // Ankara koordinatları
const defaultZoom = 6;

// İkonları buradan değiştirebilirsiniz veya farklı ikonlar ekleyebilirsiniz
const iconTypes = {
  "Kavşak": "intersection-icon",
  "Yol": "road-icon",
  // Ek ikonlar buraya eklenebilir
};

const createIcon = (iconType) => {
  return L.icon({
    iconUrl: require(`../assets/${iconType}.png`).default,
    iconSize: [30, 30],
    iconAnchor: [15, 30],
    popupAnchor: [0, -30],
  });
};

const MyMarkers = ({ data }) => {
  return (
    <>
      {data.map((item, index) => (
        <Marker
          key={index}
          position={[parseFloat(item.latitude), parseFloat(item.longitude)]}
          icon={createIcon(iconTypes[item.type])}
        >
          <Popup>
            <div className="popup-content">
              <p><strong>Kavşak Adı:</strong> {item.name}</p>
              <p><strong>Kavşak Tipi:</strong> {item.type}</p>
              {/* Diğer bilgiler buraya eklenebilir */}
            </div>
          </Popup>
        </Marker>
      ))}
    </>
  );
};

const PanoramaMarkers = ({ data }) => {
  return (
    <>
      {data.map((panorama, index) => (
        <Overlay key={index} name={panorama.name}>
          <Marker position={[panorama.latitude, panorama.longitude]}>
            <Popup>
              <div>
                <h3>{panorama.name}</h3>
                <img src={panorama.image} alt={`Panorama`} style={{ width: "100%" }} />
              </div>
            </Popup>
          </Marker>
        </Overlay>
      ))}
    </>
  );
};

const MapWrapper = () => {
  const [map, setMap] = useState(null);
  const [intersections, setIntersections] = useState([]);
  const [panoramas, setPanoramas] = useState([]);

  // Örnek veri
  const sampleIntersections = [
    { name: "Ankara Kavşağı", type: "Kavşak", latitude: 39.9334, longitude: 32.8597 },
    { name: "İstanbul Kavşağı", type: "Kavşak", latitude: 41.0082, longitude: 28.9784 },
    // Diğer örnek veriler buraya eklenebilir
  ];

  const samplePanoramas = [
    { name: "Ankara Kavşağı", latitude: 39.9334, longitude: 32.8597, image: "ankara_kavsagi.jpg" },
    { name: "İstanbul Kavşağı", latitude: 41.0082, longitude: 28.9784, image: "istanbul_kavsagi.jpg" },
    // Diğer örnek veriler buraya eklenebilir
  ];

  useEffect(() => {
    setIntersections(sampleIntersections);
    setPanoramas(samplePanoramas);
  }, []);

  const handleViewportChanged = (viewport) => {
    const bounds = map.getBounds();
    const NE = bounds.getNorthEast();
    const SW = bounds.getSouthWest();

    // Burada haritada görünen bölgenin koordinatlarını kullanarak
    // bu bölge için verileri getirebilir ve setIntersections ile güncelleyebilirsiniz
    console.log("Kuzeydoğu Koordinatları:", NE);
    console.log("Güneybatı Koordinatları:", SW);
  };

  return (
    <MapContainer
      whenCreated={setMap}
      center={center}
      zoom={defaultZoom}
      scrollWheelZoom={true} 
      onViewportChanged={handleViewportChanged}
    >
      <LayersControl position="topright">
        <BaseLayer checked name="OpenStreetMap">
          <TileLayer {...tileLayer} />
        </BaseLayer>
        {/* İsteğe bağlı olarak farklı harita katmanları eklenebilir */}

        <Overlay checked name="Kavşaklar">
          <MyMarkers data={intersections} />
        </Overlay>
        <Overlay name="Panoramik Görüntüler">
          <PanoramaMarkers data={panoramas} />
        </Overlay>
      </LayersControl>
    </MapContainer>
  );
};

export default MapWrapper;
